} else {

	if (Orders(lo.FeederName).Exists = True) {
		if (Orders(lo.FeederName).IngSrc.lo.FeederName.Done = False) {
			if (Orders(lo.FeederName).IngSrc.lo.FeederName.Exists = True) {
				lvar.SequenceNum = Orders(lo.FeederName).IngSrc.lo.FeederName.Sequence;
				lvar.StartWeight = PLCScale.lo.FeederName - lvar.OverfillAmt;

				if (lvar.StartWeight > Orders(lo.FeederName).IngSrc.lo.FeederName.TargetWeight) {
					lsys.Feeder.Mode = ReadyForDischarge;
				} else {
					lvar.FeederPaused = 1;
				}	

			} else {
				Orders(lo.FeederName).IngSrc.lo.FeederName.Done = True;
				lsys.Feeder.NextOrder();
			}
		}
	}
}

