	if (System.Accumulator.Mode = Filling and lsys.Feeder.OrderNum = System.Accumulator.OrderNum and lvar.SequenceNum = Var.AccuSequenceNum) {
		lvar.StartWeight = PLCScale.lo.FeederName;
		lvar.TargetWeight = PLCScale.lo.FeederName - Orders(lo.FeederName).IngSrc.lo.FeederName.TargetWeight + Orders(lo.FeederName).IngSrc.lo.FeederName.Preact;
